import "./Card.css"
import { Link } from "react-router-dom";


const Card = ({ id, name, image, region }) => {
    return(
        <Link to={`/${id}`}>
            <div className="card">
                <img src={image} alt="" className="flag" />
                <h1>{name}</h1>
                <h1>Continent: {region}</h1>
            </div>
        </Link>
    )
}

export default Card;
